return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'pt','pot-creation-date'=>'2026-01-07 15:19-0600','po-revision-date'=>'2026-01-07 15:19-0600','translation-revision-date'=>'2026-01-07 15:19-0600','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.8','messages'=>['%1$s is currently %2$spaused%3$s, and is not serving calendars on front end pages. You can resume serving calendars under the %4$sUtilities%5$s tab %6$shere%7$s.'=>'%1$s está atualmente %2$spausado%3$s e não está exibindo calendários nas páginas iniciais. Você pode retomar a exibição de calendários na guia %4$sUtilitários%5$s %6$saqui%7$s.','%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sVocê está executando o ICS Calendar em uma implementação do WordPress Playground.%2$s Como o ICS Calendar foi projetado para ser executado em um servidor web, alguns recursos podem não estar disponíveis ou podem não funcionar corretamente.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sSeu site está atualmente usando uma configuração de fuso horário baseada no deslocamento UTC.%2$s Isso pode produzir erros de exibição de hora no %3$splugin em locais que observam o horário de verão. Por favor, %4$saltere sua configuração de fuso horário%5$s para a cidade mais próxima de sua localização, no mesmo fuso horário, para uma exibição correta da hora. Consulte nossa %6$sdocumentação%7$s para obter informações adicionais sobre este assunto.','Important! Your %1$s configuration appears to be exceeding source calendar provider rate limits.'=>'Importante! Sua configuração %1$s parece estar excedendo os limites de taxa do provedor de calendário de origem.','If your calendars are not loading properly, please review your %1$s settings and usage:'=>'Se os seus calendários não estiverem a carregar corretamente, verifique as suas definições e a utilização do %1$s:','Do not use %1$s in your shortcodes. This feature is intended for troubleshooting only, and should not be left on permanently.'=>'Não utilize %1$s em seus códigos de atalho. Esse recurso destina-se apenas à resolução de problemas e não deve ser mantido ativado permanentemente.','Increase the %1$s %2$sTransient (cache) expiration%3$s setting to %4$s43200%5$s (12 hours) or greater, to reduce the frequency of requests to the provider. (See note below.)'=>'Aumente a configuração %1$s %2$sExpiração transitória (cache)%3$s para %4$s43200%5$s (12 horas) ou mais, para reduzir a frequência de solicitações ao provedor. (Veja a nota abaixo.)','Avoid including a large number of feeds (10 or more) from the same provider in a single %1$s shortcode.'=>'Evite incluir um grande número de feeds (10 ou mais) do mesmo provedor em um único código curto %1$s.','Temporarily pause ICS Calendar on your front-end pages using the %1$sPause Calendars%2$s utility. (24-48 hours is recommended.)'=>'Pause temporariamente o Calendário ICS nas suas páginas front-end usando o utilitário %1$sPausar Calendários%2$s. (Recomenda-se 24-48 horas.)','%1$s includes built-in caching, specifically to improve performance and avoid exceeding provider rate limits. Circumventing this caching with a very low %2$sreload%3$s setting may trigger a temporary block on your web server IP address, or possibly on your entire hosting network, by the calendar provider.'=>'%1$s inclui cache integrado, especificamente para melhorar o desempenho e evitar exceder os limites de taxa do provedor. Contornar esse cache com uma configuração muito baixa de %2$srecarregamento%3$s pode acionar um bloqueio temporário no endereço IP do seu servidor web, ou possivelmente em toda a sua rede de hospedagem, pelo provedor de calendário.','After making the recommended changes, please allow up to 24 hours for your calendar provider to remove any temporary blocks on your IP address. If you find that the problem persists, please use our %1$ssupport request form%2$s to contact us, and be sure to include your %3$ssystem report%4$s.'=>'Após fazer as alterações recomendadas, aguarde até 24 horas para que o provedor do calendário remova quaisquer bloqueios temporários em seu endereço IP. Se o problema persistir, use nosso %1$sformulário de solicitação%2$s de suporte para entrar em contato conosco e certifique-se de incluir seu %3$srelatório do sistema%4$s.','Note: Set the %1$sTransient (cache) expiration%2$s as large as possible, considering how frequently event information in your calendar is typically updated. %3$s Remember that you can use the %4$sClear Cached Calendar Data%5$s utility to manually clear the cache at any time, if needed.'=>'Observação: defina a %1$sExpiração transitória (cache)%2$s para o maior valor possível, considerando a frequência com que as informações de eventos em seu calendário são normalmente atualizadas. %3$s Lembre-se de que você pode usar o utilitário %4$sLimpar dados em cache do calendário%5$s para limpar manualmente o cache a qualquer momento, se necessário.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sObservação: %2$s %3$s a versão 10.6 altera as opções padrão para várias configurações de códigos de atalho. Para manter a consistência, esses novos padrões %4$snão%5$s são ativados ao atualizar de uma versão anterior. Se você quiser saber mais sobre as alterações, leia nossa %6$spublicação no blog%7$s ou, para mudar para os novos padrões, ative a %8$sopção na página %9$sconfigurações%10$s.','Use new parameter defaults (v.10.6)'=>'Usar novos padrões de parâmetros (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sObservação: %2$s %3$s a versão 11.0 simplifica a forma como as URLs de feed ICS são recuperadas. Essa alteração utiliza uma função padrão integrada ao WordPress, portanto, deve ser totalmente compatível com todas as instalações existentes. Se você encontrar algum novo problema após atualizar para a versão 11 ou posterior, acesse os %4$sFóruns de Suporte do WordPress%5$s para obter ajuda.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sObservação: %2$s %3$s a versão 11.5.14.2 introduz um método novo e mais seguro para lidar com parâmetros de calendário ao carregar via AJAX. Limpe todos os plug-ins de cache que estiver usando para garantir que seus calendários sejam carregados corretamente com o novo método.','%1$sWelcome to %2$s version 12!%3$s Version 12.0 introduces additional troubleshooting tools, plus a number of performance improvements and interface refinements throughout. Please see the %4$schangelog%5$s for more details on this update.'=>'%1$sBem-vindo à %2$s versão 12!%3$s A versão 12.0 apresenta ferramentas adicionais de resolução de problemas, além de várias melhorias de desempenho e refinamentos na interface. Consulte o %4$sregistro de alterações%5$s para obter mais detalhes sobre esta atualização.','Getting Started'=>'Começando','Settings'=>'Configurações','Appearance'=>'Aparência','Utilities'=>'Serviços Públicos','System Report'=>'Relatório do sistema','Support'=>'Suporte','Upgrade to %1$s!'=>'Atualize para %1$s!','Show/hide all'=>'Mostrar/ocultar tudo','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'O arquivo ICS não pôde ser recuperado ou estava vazio. Verifique se o URL está correto e verifique a configuração do php.ini para verificar se o cURL ou allow_url_fopen está disponível. Se você estiver usando espaços para delimitar vários URLs, também pode tentar usar o caractere pipe. URL afetado:','Hide past events'=>'Ocultar eventos passados','Show past events'=>'Mostrar Eventos Vencidos','Contact:'=>'Contato:','Resources:'=>'Recursos:','Click for more...'=>'Clique para mais informações...','Save to your calendar'=>'Salve em seu calendário','Cancelled'=>'Cancelado','The legacy parser option is deprecated and will be removed in a future update.'=>'A opção do analisador legado está obsoleta e será removida em uma atualização futura.','Print'=>'Imprimir','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'O atributo de código curto "currentweek" está obsoleto. Use view="week" no seu código curto.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'O atributo de código curto "legendinline" está obsoleto. Use legendstyle="inline" no seu código curto.','%1$s has %2$sresumed%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s %2$sretomou%3$s o serviço de calendários nas páginas iniciais. Se o seu site utiliza um plugin de cache, talvez seja necessário limpar o cache.','%1$s has %2$spaused%3$s serving calendars on front end pages. If your site uses a caching plugin, you may need to clear the cache.'=>'%1$s %2$sinterrompeu%3$s o fornecimento de calendários nas páginas iniciais. Se o seu site utiliza um plugin de cache, talvez seja necessário limpar o cache.','Cleared %1$s %2$s transient(s).'=>'Limpo %1$s %2$s transiente(s).','No %1$s transients were found.'=>'Não foram encontrados transientes %1$s.','All saved ICS feed URLs have been cleared.'=>'Todas as URLs de feeds ICS salvas foram apagadas.','All %1$s settings have been reset to defaults, and saved ICS feed URLs have been cleared.'=>'Todas as configurações %1$s foram redefinidas para os padrões e os URLs de feed ICS salvos foram apagados.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'A URL do seu feed parece conter credenciais de autenticação HTTP básica. Tente desativar a opção %1$s na guia %2$s acima.','Use legacy feed request method'=>'Use o método de solicitação de feed legado','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sEste URL aponta para um arquivo na sua Biblioteca de Mídia.%2$s Embora você deva conseguir usar este URL em um %3$s código de atalho, ele será um instantâneo estático do calendário no momento em que o arquivo foi criado e não refletirá nenhuma atualização futura do calendário de origem. Consulte nosso %4$sGuia do Usuário%5$s para obter instruções sobre como obter o URL correto do feed dinâmico.','Error: Could not resolve IP address for %1$s.'=>'Erro: Não foi possível resolver o endereço IP para %1$s.','Resolved IP address for %1$s:'=>'Endereço IP resolvido para %1$s:','%1$sAppearance updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sAparência atualizada. %2$s Pode ser necessário atualizar a página para ver algumas alterações.','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'O texto inserido no campo “Código curto padrão” não é um código curto válido e não foi salvo.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sConfigurações atualizadas.%2$s Pode ser necessário atualizar a página para ver algumas alterações.','calendar event'=>'evento do calendário','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'O método de solicitação de feed legado está obsoleto e será removido em uma atualização em breve. Teste seus feeds com o método de solicitação de feed legado desativado.','Future updates of %1$s will require WordPress 5.3 or newer. Please update your site to a newer version of WordPress as soon as possible.'=>'As futuras atualizações do %1$s exigirão o WordPress 5.3 ou mais recente. Atualize seu site para uma versão mais recente do WordPress o mais rápido possível.','Map'=>'Mapa','Recurring event'=>'Evento recorrente','Recurs every %1$s years'=>'Recorre a cada %1$s anos','Recurs yearly'=>'Recorre anualmente','Recurs every %1$s months'=>'Recorre a cada %1$s meses','Recurs monthly'=>'Recorre mensalmente','Recurs every %1$s weeks'=>'Recorre a cada %1$s semanas','Recurs weekly'=>'Recorre semanalmente','Recurs every %1$s days'=>'Recorre a cada %1$s dias','Recurs daily'=>'Recorre diariamente','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'A propriedade “url” no seu código abreviado %1$s parece conter tags HTML; provavelmente, sua URL foi transformada em um link clicável. Como resultado, seu calendário pode não ser exibido corretamente. Remova o link clicável do código abreviado.','The r34ics_url_get_contents() function is no longer supported.'=>'A função r34ics_url_get_contents() não é mais suportada.','Add %1$s'=>'Adicionar  %1$s','Close'=>'Fechar','ICS Feed URL:'=>'URL do feed ICS:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Certifique-se de que está usando uma URL %1$ssubscribe%2$s, e não uma URL %3$sweb view%4$s.%5$s (Ao inserir a URL diretamente no navegador da web, um arquivo %6$s deve ser baixado.)','Calendar Title:'=>'Título do calendário:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Deixe em branco para usar o título padrão do calendário. Digite %1$s para omitir o título completamente.','Calendar Description:'=>'Descrição do calendário:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Deixe em branco para usar a descrição padrão do calendário. Digite %1$s para omitir completamente a descrição.','View:'=>'Ver:','month'=>'mês','list'=>'lista','week'=>'semana','Count:'=>'Contagem:','Format:'=>'Formato:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Deixe %1$s em branco para incluir todos os eventos futuros. %2$s deve ser uma string de formato de data padrão %3$sPHP%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Mostrar descrições dos eventos %1$s(altere para um número no código curto inserido para definir o limite de palavras)%2$s','Show event locations %1$s(if available)%2$s'=>'Mostrar locais dos eventos %1$s(se disponível)%2$s','Show event organizers %1$s(if available)%2$s'=>'Mostrar organizadores do evento %1$s(se disponível)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sObservação:%2$s %3$sOpções adicionais de exibição%4$s estão disponíveis editando manualmente o código abreviado após a inserção.','Insert %1$s'=>'Insira %1$s','Do even more with %1$s version 6!'=>'Faça ainda mais com a versão 6 do %1$s!','Calendar Builder + Block Editor'=>'Criador de calendários + Editor de blocos','Configure all calendar settings with an easy visual interface, and use the new %1$s block to select your saved calendars from a dropdown in the Block Editor, no shortcode needed! %2$sLearn more...%3$s'=>'Configure todas as definições do calendário com uma interface visual fácil e utilize o novo bloco %1$s para selecionar os seus calendários guardados a partir de um menu suspenso no Editor de Blocos, sem necessidade de utilizar códigos de atalho! %2$sSaiba mais...%3$s','Additional Views and Enhanced Features'=>'Visualizações adicionais e recursos aprimorados','%1$s offers many new ways to display your calendar, including integrations with the popular %2$s and %3$s open source libraries. Month and year views with a sidebar for the selected day. "Up Next" works great for radio or TV station schedules. Widget and year availability are perfect for holiday bookings. Plus, additional capabilities are added to the core Month, Basic, List and Week views. %4$sView sample calendars...%5$s'=>'%1$s oferece muitas novas maneiras de exibir seu calendário, incluindo integrações com as populares bibliotecas de código aberto %2$s e %3$s. Visualizações mensais e anuais com uma barra lateral para o dia selecionado. “Próximos eventos” funciona muito bem para programações de rádios ou emissoras de TV. Widgets e disponibilidade anual são perfeitos para reservas de férias. Além disso, recursos adicionais foram adicionados às visualizações principais Mensal, Básica, Lista e Semanal. %4$sVeja exemplos de calendários...%5$s','Customization'=>'Personalização','Easy-to-use tools to completely customize your calendar colors, typography and more. Select one of our preset color palettes or create your own, with options to individually customize the color of each element in the calendar layout. Choose between your theme fonts, system fonts, or more than 20 included open source fonts. %1$sLearn more...%2$s'=>'Ferramentas fáceis de usar para personalizar completamente as cores, a tipografia e muito mais do seu calendário. Selecione uma das nossas paletas de cores predefinidas ou crie a sua própria, com opções para personalizar individualmente a cor de cada elemento no layout do calendário. Escolha entre as fontes do tema, as fontes do sistema ou mais de 20 fontes de código aberto incluídas. %1$sSaiba mais...%2$s','ICS Events'=>'Eventos ICS','Turns %1$s into a full calendar management system. Create and edit new events directly in WordPress, and even integrate them seamlessly with your existing external ICS feeds. %2$sLearn more...%3$s'=>'Transforma %1$s em um sistema completo de gerenciamento de calendário. Crie e edite novos eventos diretamente no WordPress e integre-os perfeitamente aos seus feeds ICS externos existentes. %2$sSaiba mais...%3$s','Localized Admin Interface'=>'Interface administrativa localizada','All %1$s admin pages are translated into dozens of languages, including English, Czech, Danish, German, Greek, Spanish, Estonian, Finnish, French, Hungarian, Italian, Japanese, Korean, Lithuanian, Latvian, Norwegian, Dutch, Polish, Portuguese, Romanian, Russian, Slovak, Serbian, Swedish, Turkish, Ukrainian, and Chinese.'=>'Todas as páginas administrativas %1$s estão traduzidas para dezenas de idiomas, incluindo inglês, tcheco, dinamarquês, alemão, grego, espanhol, estoniano, finlandês, francês, húngaro, italiano, japonês, coreano, lituano, letão, norueguês, holandês, polonês, português, romeno, russo, eslovaco, sérvio, sueco, turco, ucraniano e chinês.','Visit %1$s to learn more.'=>'Visite %1$s para saber mais.','Calendar Builder screenshot'=>'Captura de tela do Calendar Builder','Appearance screenshot'=>'Captura de tela de aparência','Available now!'=>'Já disponível!','Get %1$s!'=>'Obtenha %1$s!','Extensive color palette and typography options are available with %1$s. %2$sLearn More%3$s'=>'Uma ampla paleta de cores e opções de tipografia estão disponíveis com %1$s. %2$sSaiba mais%3$s','Color Palette'=>'Paleta de Cores','Match calendar color palette to current Block Theme colors'=>'Combinar a paleta de cores do calendário com as cores atuais do tema do bloco','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Substitui a paleta de cores neutras padrão %1$s pelas cores mais próximas da paleta de cores do Editor de sites atual ou do arquivo %2$s do seu tema. As seleções de cores são algorítmicas e algumas combinações podem não passar nos testes de contraste de acessibilidade. Essa configuração não tem efeito se você estiver usando um tema “clássico” que não inclua um arquivo %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar appearance or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sEsta é atualmente uma funcionalidade beta.%2$s Pode ser necessário fazer alguns ajustes na aparência do seu calendário ou no CSS para uma exibição ideal, especialmente se você tiver codificado seus feeds por cores. A funcionalidade está sujeita a alterações.','Dark mode'=>'Modo escuro','Inverts color palette (light colors on a dark background).'=>'Inverte a paleta de cores (cores claras em fundo escuro).','Save Changes'=>'Salvar alterações','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Obrigado por instalar %1$s. Antes de criar seu primeiro código de calendário, acesse a página %2$sConfigurações gerais%3$s e verifique se as configurações de idioma, fuso horário e formato de data/hora do seu site estão corretas. Consulte nosso %4$sGuia do usuário%5$s para obter mais informações.','Get started with %1$s in four easy steps... and you\'ve already completed step one! Check out our %2$sQuick Start Guide%3$s for the rest.'=>'Comece com %1$s em quatro etapas fáceis... e você já concluiu a primeira etapa! Confira nosso %2$sGuia de Início Rápido%3$s para saber o restante.','Quick Start Guide'=>'Guia de Início Rápido','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Um extenso %1$sGuia do Usuário%2$s está disponível em nosso site. Abaixo estão alguns links rápidos para os principais recursos da documentação.','General:'=>'Geral:','General WordPress Settings'=>'Configurações gerais do WordPress','%1$s Settings'=>'%1$s configurações','Working with Shortcodes:'=>'Trabalhando com códigos de atalho:','Shortcode Overview'=>'Visão geral do código abreviado','Shortcode Builder'=>'Gerar Shortcode','Shortcode Parameters Reference'=>'Referência dos parâmetros do código curto','Advanced Topics:'=>'Tópicos avançados:','FAQs and Tips'=>'Perguntas frequentes e dicas','CSS Guide'=>'Guia CSS','Developer Resources'=>'Recursos para desenvolvedores','GDPR'=>'GDPR','Loading'=>'Carregando','Always use AJAX to render calendars'=>'Sempre use AJAX para renderizar calendários','AJAX loading is now automatic. You can override AJAX, if necessary, by adding %1$s to your shortcode.'=>'O carregamento AJAX agora é automático. Você pode substituir o AJAX, se necessário, adicionando %1$s ao seu código de atalho.','Increase memory limit when rendering calendars'=>'Aumentar o limite de memória ao renderizar calendários','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Se o seu calendário não estiver carregando e apresentar um erro fatal de “memória insuficiente”, tente aumentar o limite de memória. Recomenda-se um mínimo de 512 MB. %1$s Observações: 1) Alguns provedores de hospedagem podem não permitir que os aplicativos substituam a configuração padrão do servidor. 2) Não é possível definir essa opção abaixo do limite de memória padrão atual do seu servidor.','deprecated'=>'obsoleto','Some servers may not support the default feed request method. If your feeds are not loading, turn on this option to use the legacy request method. This feature is deprecated and will be removed in a future update.'=>'Alguns servidores podem não suportar o método padrão de solicitação de feed. Se seus feeds não estiverem carregando, ative esta opção para usar o método de solicitação antigo. Este recurso está obsoleto e será removido em uma atualização futura.','Default shortcode'=>'Código curto padrão','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Se o seu site incluir um grande número de códigos de calendário com configurações semelhantes, você pode inserir aqui um código “base” padrão com os parâmetros que devem ser os mesmos para todos os calendários. Os códigos individuais no site podem então incluir apenas os parâmetros exclusivos desse calendário, como segue: %1$s Quaisquer parâmetros incluídos no código individual substituirão o que está definido aqui.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Permita o acesso a esses nomes de host que resolvem para endereços IP reservados.','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Se o servidor do seu calendário estiver hospedado no mesmo servidor físico que o seu site, fizer parte da mesma rede local ou usar um %1$sendereço IP reservado%2$s, insira o nome do host aqui para permitir o acesso. Para vários servidores de calendário, insira um nome de host por linha. Consulte a %3$s%4$s documentação%5$s para obter mais informações.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Insira um nome de host por linha. Os nomes de host são o nome de domínio base, não um URL completo. %1$s Por exemplo, você deve inserir %2$s, não %3$s.','Allow access to these ports'=>'Permita o acesso a estas portas','WordPress automatically allows access to ports 80, 443, and 8080. If you need to be able to access source calendars that use non-standard ports, enter the port numbers here, separated by commas.'=>'O WordPress permite automaticamente o acesso às portas 80, 443 e 8080. Se você precisar acessar calendários de origem que utilizam portas não padrão, insira os números das portas aqui, separados por vírgulas.','Caching'=>'Cache','Transient (cache) expiration'=>'Expiração transitória (cache)','seconds'=>'segundos','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour). Minimum allowed value is 120 (2 minutes).'=>'Define por quanto tempo os dados do feed do calendário devem ser armazenados em cache no servidor (transientes do WordPress) antes de serem recarregados. O padrão é 3600 (1 hora). O valor mínimo permitido é 120 (2 minutos).','Admin'=>'Admin','Minimum access role'=>'Função de acesso mínimo','Identifies the minimum user role that is allowed to access %1$s admin pages. Certain areas such as Settings are further restricted to %2$s users only (%3$s users on Multisite configurations).'=>'Identifica a função mínima do usuário que tem permissão para acessar %1$s páginas administrativas. Certas áreas, como Configurações, são ainda mais restritas a %2$s usuários apenas (%3$s usuários em configurações multisite).','Register Customizer'=>'Personalizador de registro','WordPress no longer includes a link to the Customizer in the Appearance menu when a Block Theme is active. Check this box if you wish to use the Customizer, e.g. for the Additional CSS input. Note: Some themes or plugins may already register the Customizer, in which case, this setting will have no effect. (The checkbox only enables the Customizer when checked; it does not disable the Customizer when unchecked.'=>'O WordPress já não inclui um link para o Personalizador no menu Aparência quando um Tema de Bloco está ativo. Marque esta caixa se desejar utilizar o Personalizador, por exemplo, para a entrada CSS adicional. Nota: Alguns temas ou plugins podem já ter registado o Personalizador, caso em que esta configuração não terá qualquer efeito. (A caixa de seleção apenas ativa o Personalizador quando marcada; não desativa o Personalizador quando desmarcada.','Remove "Add ICS Calendar" button in Classic Editor'=>'Remover o botão "Adicionar calendário ICS" no Editor Clássico','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Por padrão, o Calendário ICS adiciona um botão “Adicionar Calendário ICS” à barra de ferramentas acima do editor WYSIWYG ao usar o Editor Clássico. Marque esta caixa para remover o botão. Não tem efeito em sites que usam o Editor de Blocos (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s versão 10.6 introduziu novos valores padrão para vários parâmetros de shortcode. As novas instalações utilizam automaticamente os novos valores padrão, mas as instalações atualizadas continuarão a utilizar os valores padrão antigos, a menos que esta caixa seja marcada. Leia mais sobre estas alterações no %2$snosso blog%3$s.','User Guide'=>'Guia do Usuário','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Nosso guia completo do usuário está disponível com tradução completa para dezenas de idiomas em nosso site:','For assistance, please use our %1$ssupport request form%2$s.'=>'Para obter assistência, utilize nosso %1$sformulário de solicitação de suporte%2$s.','When contacting support, please include the %1$ssystem report%2$s from this page.'=>'Ao entrar em contato com o suporte, inclua o %1$srelatório do sistema%2$s desta página.','Spread the word!'=>'Espalhe a palavra!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Se você achar %1$s útil, pode ajudar a apoiar nosso crescimento e desenvolvimento contínuos com uma avaliação de %2$scinco estrelas%3$s. Obrigado!','Calendar Status: %1$sPaused%2$s'=>'Status do calendário: %1$sPausado%2$s','Calendar Status: %1$sActive%2$s'=>'Status do calendário: %1$sAtivo%2$s','Use the pause button if you need to temporarily turn off %1$s on your front end pages.'=>'Use o botão de pausa se precisar desativar temporariamente %1$s nas suas páginas iniciais.','Resume Calendars'=>'Calendários de currículos','Pause Calendars'=>'Calendários de pausa','No content will be altered, but your calendars will be hidden and no %1$s asset files (JavaScript, CSS) will be loaded on front-end pages. If you are using caching via a plugin or through your hosting provider, you may need to clear the cache after changing this setting.'=>'Nenhum conteúdo será alterado, mas seus calendários serão ocultados e nenhum arquivo de recurso %1$s (JavaScript, CSS) será carregado nas páginas front-end. Se você estiver usando cache por meio de um plugin ou do seu provedor de hospedagem, talvez seja necessário limpar o cache após alterar essa configuração.','%1$s Data Cache'=>'%1$s Cache de dados','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Isso limpará imediatamente todos os dados do calendário armazenados em cache (limpar transientes), forçando o WordPress a recarregar todos os calendários na próxima vez que forem visualizados. O armazenamento em cache será retomado como antes.','Clear Cached Calendar Data'=>'Limpar dados armazenados em cache do calendário','If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Se você estiver usando um plugin de cache de terceiros, talvez seja necessário limpar o cache de todo o site após executar este utilitário.','Are you sure? This will reset all %1$s settings to their defaults. Your saved calendar configurations and shortcodes will be retained, but resetting the defaults may change the appearance of your calendars. If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Tem certeza? Isso redefinirá todas as configurações %1$s para os padrões. Suas configurações salvas do calendário e códigos de atalho serão mantidos, mas redefinir os padrões pode alterar a aparência dos seus calendários. Se você estiver usando um plugin de cache de terceiros, talvez seja necessário limpar o cache de todo o site após executar este utilitário.','Only clear transients (default)'=>'Apenas transientes claros (padrão)','Also clear all saved ICS feed URLs'=>'Limpe também todos os URLs de feeds ICS salvos.','Reset %1$sall%2$s %3$s settings (including transients and feed URLs)'=>'Redefinir %1$stodas%2$s %3$s as configurações (incluindo transientes e URLs de feed)','Last cleared:'=>'Última limpeza:','never'=>'nunca','ICS Feed URL Tester'=>'Testador de URL de feed ICS','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Se você estiver preocupado com a possibilidade de o plugin não estar recuperando corretamente o seu feed, você pode testar a URL aqui.','Enter feed URL...'=>'Insira o URL do feed...','Test URL'=>'Testar URL','Results:'=>'Resultados:','%1$s received.'=>'%1$s recebido.','This appears to be a valid ICS feed URL.'=>'Esta parece ser uma URL válida para o feed ICS.','unknown'=>'desconhecido','This does not appear to be a valid ICS feed URL.'=>'Esta URL não parece ser um feed ICS válido.','Could not retrieve data from the requested URL.'=>'Não foi possível recuperar os dados do URL solicitado.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Ocorreu um erro desconhecido ao tentar recuperar o URL solicitado.','Please copy the following text and include it in your message when emailing support.'=>'Copie o texto a seguir e inclua-o em sua mensagem ao enviar um e-mail para o suporte.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Inclua também o código abreviado %1$s exatamente como você o inseriu na página afetada.','No events found.'=>'Nenhum evento encontrado.','Previous Page'=>'Página Anterior','Next Page'=>'Próxima página','All Day'=>'Todos os Dias','Previous Month'=>'Mês Anterior','Next Month'=>'Próximo Mês','Today'=>'Hoje','Month selection'=>'Seleção do mês','No events.'=>'Sem eventos.','No additional events this month.'=>'Não há eventos adicionais este mês.','Week selection'=>'Seleção da semana','Last week'=>'Semana passada','This week'=>'Esta semana','Next week'=>'Próxima semana','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Transforme seu Google Agenda, Microsoft Office 365 ou Apple iCloud Calendar em uma experiência WordPress perfeitamente integrada, com atualização automática e sem necessidade de manutenção.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
